import './App.css';
import Navbar from './components/Navbar'

function App() {

  function fetchWorkers() {
    console.log("Fetching...")

    fetch('http://127.0.0.1:8000/api/workers/')
    .then(response => response.json())
    .then(data => data)
  }

  let workers = fetchWorkers()
  console.log(workers)

  return (
    <div className="container">
      <Navbar />
      <h1>Hello wolrd!</h1>
    </div>
  );
}

export default App;
